import SingleDayCard from './components/SingleDayCard';
import './ForecastWeatherCard.css';

function ForcastWeatherCard(props) {
    const { data } = props;
    return (
        <div className="forecast-weather-card">
            <SingleDayCard Date={data[0].date} Day={data[0].day} weather={data[0].weather} minTemp={data[0].minTemp} maxTemp={data[0].maxTemp} />
            <SingleDayCard Date={data[1].date} Day={data[1].day} weather={data[1].weather} minTemp={data[1].minTemp} maxTemp={data[1].maxTemp} />
            <SingleDayCard Date={data[2].date} Day={data[2].day} weather={data[2].weather} minTemp={data[2].minTemp} maxTemp={data[2].maxTemp} />
            <SingleDayCard Date={data[3].date} Day={data[3].day} weather={data[3].weather} minTemp={data[3].minTemp} maxTemp={data[3].maxTemp} />
        </div>
    )
}

export default ForcastWeatherCard;
